import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import Footer from '../Footer';
import Button from '../Button';



function Events() {
  return (
    <>
    <div>
      <Cards />
      {button && <Button buttonStyle='btn--outline'>SIGN UP</Button>}


      <Footer />
    </div>
    </>
  );
}


export default Events;
